import React from 'react';
import Card from './Card';
import { robots } from './robots.js';

const CardList = () => {  
  return (
    <div className="App">
      robots.map((user,i)={
       <Card id={robots[i].id} name={robots[i].name} email={robots[i].email}/>
       });
    </div>
)
}

export default CardList;
